import Badge from "react-bootstrap/Badge";
import Button from "react-bootstrap/Button";
function App() {
  return (
    <section>
      <div>
        <h1>
          This is Heading
          <Badge bg="secondary" as={Button}>
            New
          </Badge>
        </h1>
      </div>
    </section>
  );
}
export default App;
